import React from 'react'
import cn from 'classnames'

import './Header.css'
import Button from '../Button'
import { empty } from '../../utils'


export default function Header() {

    return (
        <div className="header">
            <div className="header__center">
                <div className="header__logo" />
                <input
                    className="header__search"
                    placeholder="Поиск"
                />
                <RedButton
                    text={ 'Загрузить отчёт' }
                    // TODO: переход на страницу с загрузкой отчёта
                />
                <RedButton text={ 'продавай с нами' }/>
                <RedButton
                    text={ 'интернет-банк' }
                    className="header-red-button__with-arrow"
                />
            </div>
        </div>
    )
}

interface RedButtonProps {
    text: string
    onClick?: any
    className?: any
}

function RedButton({ text, onClick = empty, className } : RedButtonProps) {
    return (
        <Button
            className={cn('header-red-button', className)}
            onClick={ onClick }>
            { text }
        </Button>
    )
}
